@-moz-document domain("discord.com") {
  /* Muda os emojis do Twitter para o estilo do iOS no Discord */

  .emoji {
    display: inline-block;
    background-size: 100% 100%;
    background-repeat: no-repeat;
    background-position: center center;
  }

  /* Substitui os emojis do Twitter pelos emojis do iOS */
  .emoji.Emoji--1 {
    background-image: url(https://em-content.zobj.net/thumbs/120/apple/354/thinking-face_1f914.png);
  }

  .emoji.Emoji--2 {
    background-image: url(https://em-content.zobj.net/thumbs/120/emojipedia/294/face-with-diagonal-mouth_1fae4.png);
  }

  .emoji.Emoji--3 {
    background-image: url(https://www.pngfind.com/pngs/m/206-2065358_cringe-sticker-ahegao-emoji-hd-png-download.png);
  }

  /* Continue com as outras classes de emojis, se necess√°rio */
}
